import React from "react";

const Attendance = () => {
  return (
    <div>
      <h1>Attendance Page</h1>
      <tr>Member</tr>
      <tr>Monthly</tr>
      <tr>Year</tr>
      <tr>Status</tr>
      <tr>Time-In</tr>
      <tr>Time-Out</tr>

      <table></table>
    </div>
  );
};

export default Attendance;
